import React from 'react';
import Concert from '../assets/SANDMAN GOODWILL NOV 13_Trim.mp4'
 
const Home = () => {
    return (
        <div>
            <video className="video" autoPlay loop muted>
                <source src={Concert} type="video/mp4" />
            </video>
            <h1>Sandmannnnnnnn</h1>
        </div>
    );
};
 
export default Home;
